window.bookSummaryJSON = "<p>Alex Rogers is a young, intelligent workaholic who jumped from high school to college to a technical career with little time for a personal life. With his dog Kinsey, he pursues his only vice, wandering in the wilderness areas of Washington State, dreaming of adventure.</p> <p>Without warning, he and Kinsey find themselves in an unfamiliar land, unable to speak the language and fighting for their lives. It is here that Alex discovers he has been dropped in the middle of an ancient struggle for power, in a land where magic replaces science. If he can survive the near future, he has the potential to become a great wizard feared by the very people he needs to protect.</p>"; 
